import "./Header.css"
import React from "react";

const Header = () => {
    return (
        <header className="header">
            <div className="logo" role="img" aria-label='Fatnezz logo'>
                <img src="../assets/images/logo.png" alt="Fatnezz logo" />
            </div>
        </header>
    )
}

export default Header
